import React, { useState } from "react";
import { Button, styled } from "reakit";
import { Colors, Size, Fonts } from "../../assets/common/Styles";

const Label = styled.label`
  padding: 0.2rem;
  text-transform: uppercase;
  color: ${Colors.DustGray};
  font-weight: bold;
  font-size: ${Fonts.FontSize.small};
`;
const MenuButton = (props) => {
  return (
    <Feature check="forms.buyerDetails.address">
      <Column size={{ sm: 12, md: 3 }}>
        <Field
          name={FormFieldNames.addressLine1}
          id="addressLine1_BuyerDetails"
          type="text"
          component={Input}
          placeholder={intl.formatMessage({
            id: "BuyerDetailsForm.addresses",
          })}
          formatMessageId={intl.formatMessage({
            id: "errorMessageAddress",
          })}
          disabled={this.handleFieldDisabling(FormFieldNames.addressLine1)}
        />
      </Column>
    </Feature>
  );
};

export default MenuButton;
